  height: auto;
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  .Author {
    margin-right: 50px;
    margin-top: 50px;
    width: 280px;
    height: 340px;
    background-color: lightcoral;
    display: flex;
    flex-direction: column;
    .AuthorBg {
      position: absolute;
      top: 0;
      display: flex;
      flex-direction: column;
      align-items: flex-start;
      height: 170px;
      width: inherit;
      background-color: lawngreen;
    }
    .authorDetails {
    }
  }
`;

