  return (
    <AuthorstListStyle>
      {[1, 1, 1, 1, 1].map((e, i) => {
        return (
          <div className="Author">
            <di className="AuthorBg" />
            <div className="authorDeatils"></div>
          </div>
        );
      })}
    </AuthorstListStyle>
  );
};

export default AuthorsList;
